export const Header = ({
  ...props
}: React.HTMLAttributes<HTMLHeadingElement>) => {
  return (
    <header
      {...props}
      className={classnames(
        "py-[12px] flex items-center justify-center h-[56px] sticky top-[0px] z-10 bg-white",
        props.className
      )}
    >
      <Logo className={"shrink-0"} />
    </header>
  );
};
export const HeadingWithButton = ({
  ...props
}: React.HTMLAttributes<HTMLHeadingElement>) => {
  return (
    <header
      {...props}
      className={classnames(
        "py-[12px] flex items-center justify-center justify-between mx-[24px] h-[56px] sticky top-[0px] z-10 bg-white",
        props.className
      )}
    >
      <Logo />
      <ButtonPrimary anchor size={"s"} className={"w-[127px]"}>
        Protect me now
      </ButtonPrimary>
    </header>
  );
};
